INSERT INTO `field_data_body` VALUES ('node','artist_page',0,1,1,'und',0,'<p>Hello World This is an artists page.</p>','','filtered_html'),('node','artist_page',0,2,2,'und',0,'Total coolness, my new project.','','plain_text'),('node','artist_page',0,3,5,'und',0,'<p>asdqwe zxc Added this</p>','','filtered_html'),('node','artist_page',0,4,13,'und',0,'<p>This will be the coolest project EVAH.</p><p>[[{\"type\":\"media\",\"view_mode\":\"media_large\",\"fid\":\"6\",\"attributes\":{\"alt\":\"\",\"class\":\"media-image\",\"typeof\":\"foaf:Image\"}}]]</p>','','artist_filtered_html'),('node','artist_page',0,5,9,'und',0,'<p>Testing media module and video embedding and WYSIWYG editor.</p><p><!--break--></p><p><strong>kjkj&nbsp;<em>kkjkjk&nbsp;<u>kjkjkjkj&nbsp;</u></em></strong></p><p style=\"text-align: center; \"><strong><em><u><strike>iuijkjkj&nbsp;</strike></u></em></strong></p><p style=\"text-align: justify; \"><strong><em><u><strike>Heloo</strike></u></em></strong></p><ul><li style=\"text-align: justify; \">1</li><li style=\"text-align: justify; \">2</li><li style=\"text-align: justify; \">3</li></ul><ol><li style=\"text-align: justify; \">1</li><li style=\"text-align: justify; \">2</li><li style=\"text-align: justify; \">3</li></ol><p style=\"text-align: justify; \"><a href=\"http://google.com\" target=\"_blank\">Google</a></p><table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 500px; \"><tbody><tr><td>1</td><td>2</td></tr><tr><td>3</td><td>4</td></tr><tr><td>5</td><td>6</td></tr></tbody></table><p style=\"text-align: justify; \">&nbsp;</p><hr><h2>Heading2</h2>\r\n<pre>$c = \'Hello World\';\r\nforeach () {\r\n  Hello;\r\n}</pre>\r\n<p><span style=\"font-family: \'lucida sans unicode\', \'lucida grande\', sans-serif; \">Hello Lucida</span></p><p><span style=\"font-size:26px;\"><span style=\"font-family: \'lucida sans unicode\', \'lucida grande\', sans-serif; \">Bigger</span></span></p><p><span style=\"font-family: \'lucida sans unicode\', \'lucida grande\', sans-serif; font-size: 26px; \">Why me?</span></p><p>&nbsp;</p><p>[[{\"type\":\"media\",\"view_mode\":\"media_large\",\"fid\":\"3\",\"attributes\":{\"alt\":\"\",\"class\":\"media-image\",\"typeof\":\"foaf:Image\"}}]]</p>','','artist_filtered_html'),('node','artist_page',0,6,10,'und',0,'<p>Here should be a photo.</p>','','artist_filtered_html'),('node','artist_page',0,7,12,'und',0,'<p>You can <strong>BOLD TEXT</strong>. <u>Underline</u>. Images:</p><p><img alt=\"\" src=\"/dev/sites/default/files/u3/beautiful-sky.jpg\" style=\"width: 800px; height: 600px; \" /></p>','','artist_filtered_html'),('node','artist_page',0,8,14,'und',0,'<p>Welcome to Boosted. This is editable content and can be changed by going to Content - home.</p><p>Create an account by clicking on <strong><a href=\"user/register\">Register</a></strong>.</p>','','full_html'),('node','category',0,9,15,'und',0,'<p>Music is what makes the world go around.</p>','','artist_filtered_html'),('node','category',0,10,16,'und',0,'<p>Description of Poems category.</p>','','artist_filtered_html'),('node','category',0,11,17,'und',0,'<p>Crafting description.</p>','','artist_filtered_html'),('node','category',0,12,18,'und',0,'<p>Dance description</p>','','artist_filtered_html'),('node','category',0,13,19,'und',0,'<p>Painting description.</p>','','artist_filtered_html'),('node','artist_page',0,14,20,'und',0,'<p>This is the Default value for project pages. You can change it at <a href=\"admin/structure/types/manage/artist-page/fields\">admin/structure/types/manage/artist-page/fields</a>.</p>','','artist_filtered_html');
